import { getMsgMonitorDetail } from '@/api/msgCenter/msgMonitor'
export default {
  name: 'msgMonitor-Form',
  data() {
    return {
      detailForm: {},
      visible: false,
      loading: false
    }
  },
  methods: {
    init(id) {
      this.visible = true
      this.loading = true
      getMsgMonitorDetail(id).then((res) => {
        this.loading = false
        this.detailForm = res.data
      }).catch(() => {
        this.loading = false
      })
    },
  }
}
